            htmlObject = new HtmlObject("container_white", "h2_right", "p_right", "icon_right", "ul_right", "r")
            // container = "container_white"
            // h2 = "h2_right"
            // p = "p_right"
            // icon = "icon_right"
            // ul = "ul_right"
            // pos = "r"
        }
        i++;
        return <Project key={data.id} project={data} container={container} htmlsetting={htmlObject}/>
    })

    return (
        myProjects
    )
}

export default MainContentPortfolio
